11.body:
Atlas77 comes with a relatively small standard library, which includes functions & types for input/output, file handling, string & list manipulation, time & math functions. The standard library is imported using the import keyword, followed by the library name. For example: import "std/io" func
main()
->
i64
{ print("Hello, World!");
} As of writing this document, the following standard libraries are available: std/io: Input/output functions print_int(i: i64): Print an integer to the console print_float(f: f64): Print a floating-point number to the console print_uint(u: u64): Print an unsigned integer to the console print_bool(b: bool): Print a boolean value to the console Yes it is very limited, but tbh str, array & structs are still not implemented, so it's a bit hard to implement more complex functions.

